function fetchData() {
  fetch('http://localhost:3000/api/v1/jobs')
  .then(response => {
    if (!response.ok) {
      throw Error('An error occurred. Please try again.')
    }
    return response.json()
  }).then(data => {
    console.log(data);
    const html = data.map(job => {
      return 'Position:' + job.position
    })
    document.querySelector("#app").insertAdjacentHTML('afterbegin',"<h1>heloo</h1>");
  }).catch(error => {
    console.log(error)
  });
}

fetchData()
